import Link from 'next/link';
import Head from 'next/head';
import Layout from '../../components/layout';

export default function firstPost() {
  return (
    <Layout>
      <Head>
        <title>Custom Title Woohoo!</title>
      </Head>
      <h1>First Post</h1>
      <h2>
        <Link href="/"><a>Back to Home</a></Link>
      </h2>
    </Layout>
  )
}
